import React from 'react'
import {
  TextField,
  Button,
  Box} from "@material-ui/core";
import { Home } from "@material-ui/icons";

export default function signIn() {
    return (
      <Box>
        <TextField
          required
          id="standard-basic"
          label="Email"
          type="email"
          variant="outlined"
        />{" "}
        <br />
        <br />
        <br />
        <TextField
          required
          id="standard-basic"
          label="Password"
          type="password"
          variant="outlined"
        />
      </Box>
    );
}
